import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Set a mobile viewport to ensure the mobile menu is active
    await page.setViewportSize({ width: 375, height: 667 });

    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_mobile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_mobile.png'));

    // Step 1: Open the mobile menu by clicking the "All" trigger
    await page.waitForSelector('div.nav-menu', { timeout: 5000 });
    await page.click('div.nav-menu');

    // Step 2: Verify the mobile menu overlay is visible
    await page.waitForSelector('#mobileMenuOverlay', { state: 'visible', timeout: 5000 });
    const isMenuVisible = await page.isVisible('#mobileMenuOverlay');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Step 3: Click on a category link within the menu
    const electronicsLink = page.locator('.mobile-menu a').filter({ hasText: 'Electronics' }).first();
    await electronicsLink.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsLink.click();

    // Take a screenshot to show the state after clicking a link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_link_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_link_click.png'));

    // Step 4: Close the mobile menu using the close button
    const closeButton = page.locator('.mobile-menu button.close-mobile-menu').first();
    await closeButton.waitFor({ state: 'visible', timeout: 5000 });
    await closeButton.click();

    // Step 5: Verify the mobile menu overlay is hidden
    await page.waitForSelector('#mobileMenuOverlay', { state: 'hidden', timeout: 5000 });
    const isMenuHidden = await page.isHidden('#mobileMenuOverlay');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_menu_closed.png'));

    return {
      success: true,
      action: "Successfully tested opening, navigating within, and closing the mobile menu.",
      extractedData: {
        menuOpenedSuccessfully: isMenuVisible,
        menuClosedSuccessfully: isMenuHidden
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test mobile menu navigation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
